    <script>

        function openPopup() {
            document.body.classList.add('popup-open');
        }
        
        function closePopup() {
            document.body.classList.remove('popup-open');
            document.getElementById('authModals').innerText = '';
            document.getElementById('authModals').innerHTML = '';
        }

        document.addEventListener("DOMContentLoaded", function () {

            function calculateTotalCost() {
                const nightlyRate = parseFloat(document.getElementById('nightlyRate').innerText);
                const nightsText = document.getElementById('nightsTotalShowPrice').innerText;
                const numberOfNights = parseInt(nightsText.match(/\d+/)[0]);
                const cleaningFee = parseFloat(document.getElementById('cleaningFeeVal').value);
                const totalCost = nightlyRate * numberOfNights;
                const totalAfterCost = totalCost + cleaningFee;
                document.getElementById('totalPrice').innerText = `$${totalCost.toFixed(2)}`;
                document.getElementById('totalBeforeTax').innerText = `$${totalAfterCost.toFixed(2)}`;
            }

            const displayLeft = document.querySelector(".display-left");
            const daysLeft = document.querySelector(".container:nth-child(2) .days");
            const selectedLeft = document.querySelector(".container:nth-child(2) .selected");
          
            const displayRight = document.querySelector(".display-right");
            const daysRight = document.querySelector(".container:nth-child(3) .from-today");
            const selectedRange = document.querySelector(".container:nth-child(3) .selected-range");
          
            const previous = document.querySelector(".left");
            const next = document.querySelector(".right");
          
            let date = new Date();
            let year = date.getFullYear();
            let month = date.getMonth();
          
            let startDate = null;
            let endDate = null;
          
            function displayCalendar(display, days, offset = 0, isFromToday = false) {
              const targetDate = new Date(year, month + offset, 1);
              const firstDay = new Date(targetDate.getFullYear(), targetDate.getMonth(), 1);
              const lastDay = new Date(targetDate.getFullYear(), targetDate.getMonth() + 1, 0);
              const firstDayIndex = firstDay.getDay();
              const numberOfDays = lastDay.getDate();
          
              let formattedDate = targetDate.toLocaleString("en-US", {
                month: "long",
                year: "numeric",
              });
          
              display.innerHTML = `${formattedDate}`;
              days.innerHTML = "";
          
              for (let x = 1; x <= firstDayIndex; x++) {
                const div = document.createElement("div");
                days.appendChild(div);
              }
          
              for (let i = 1; i <= numberOfDays; i++) {
                let div = document.createElement("div");
                let currentDate = new Date(targetDate.getFullYear(), targetDate.getMonth(), i);
          
                if (isFromToday && currentDate < new Date()) {
                  div.classList.add("disabled");
                } else {
                  div.dataset.date = currentDate.toDateString();
                  div.innerHTML = i;
                  days.appendChild(div);
          
                  if (
                    currentDate.getFullYear() === new Date().getFullYear() &&
                    currentDate.getMonth() === new Date().getMonth() &&
                    currentDate.getDate() === new Date().getDate()
                  ) {
                    div.classList.add("current-date");
                  }
                }
              }
          
              updateSelectedRange();
            }
          
            function updateSelectedRange() {
              const allDays = document.querySelectorAll(".days div");
          
              allDays.forEach((day) => {
                day.classList.remove("current-date", "in-range");
              });
          
              if (startDate && endDate) {
                const start = new Date(startDate);
                const end = new Date(endDate);
          
                allDays.forEach((day) => {
                  const dayDate = new Date(day.dataset.date);
                  if (dayDate >= start && dayDate <= end) {
                    day.classList.add("in-range");
                  }
                });
              }
          
              if (startDate) {
                const startDay = document.querySelector(`div[data-date='${startDate}']`);
                if (startDay) startDay.classList.add("current-date");
              }
          
              if (endDate) {
                const endDay = document.querySelector(`div[data-date='${endDate}']`);
                if (endDay) endDay.classList.add("current-date");
              }
            }

            function displaySelected(days, selected, isRange = false) {
              const dayElements = days.querySelectorAll("div");
              dayElements.forEach((day) => {
                day.addEventListener("click", (e) => {
                  const selectedDate = e.target.dataset.date;
                  if (selectedDate && !e.target.classList.contains("disabled")) {
                    if (isRange) {
                      if (!startDate || (startDate && endDate)) {
                        startDate = selectedDate;
                        endDate = null;
                      } else {
                        endDate = selectedDate;
                        if (new Date(startDate) > new Date(endDate)) {
                          [startDate, endDate] = [endDate, startDate];
                        }
                      }
                      updateSelectedRange();
                      updateSelectedElements();
                    } else {
                      startDate = selectedDate;
                      updateSelectedRange();
                    }
                  }
                });
              });
            }

            document.getElementById('clearCalendarData').addEventListener("click", () => { 

                startDate = null;
                endDate = null;
              
                const allDays = document.querySelectorAll(".days div");
                allDays.forEach((day) => {
                  day.classList.remove("current-date", "in-range", "disabled");
                });
              
                updateSelectedRange();
                updateSelectedElements();
            });

            function formatDate(dateString) {
                const date = new Date(dateString);
                const day = date.getDate();
                const month = date.getMonth() + 1;
                const year = date.getFullYear();
                return `${month}/${day}/${year}`;
            }

            function updateSelectedElements() {
              if (startDate !== null && endDate !== null) {
                document.getElementById('checkIn-book_it').value = formatDate(startDate);
                document.getElementById('checkOut-book_it').value = formatDate(endDate);
                document.getElementById('changeValueCheckin').innerHTML = formatDate(startDate);
                document.getElementById('changeValueCheckout').innerHTML = formatDate(endDate);
                const start = new Date(startDate);
                const end = new Date(endDate);
                const nights = Math.round((end - start) / (1000 * 60 * 60 * 24));
                document.getElementById('daysLeft').innerHTML = `${nights} nights`;
                document.getElementById('nightsTotalShowPrice').innerHTML = `${nights} nights`;
                document.getElementById('datewFromTo').innerText = `${startDate} - ${endDate}`;
                document.getElementById('showAfterCalendar').style = 'display:block';
                document.getElementById('replaceTextButton').innerHTML = 'Reserve';
                document.getElementById('removeAddTextPrice').style = 'display:none';
                document.getElementById('priceTotalHeaderShow').style = 'display:block';
                document.getElementById('pricePerNightHeaderShow').style = 'display:block';
                document.getElementById('cleaningFeeVal').addEventListener('input', calculateTotalCost);
                calculateTotalCost();
              }
            }
          
            function slide(direction) {
              daysLeft.classList.add(`slide-${direction}`);
              daysRight.classList.add(`slide-${direction}`);
          
              setTimeout(() => {
                daysLeft.classList.remove(`slide-${direction}`);
                daysRight.classList.remove(`slide-${direction}`);
              }, 300);
            }
          
            displayCalendar(displayLeft, daysLeft);
            displayCalendar(displayRight, daysRight, 1, true);
          
            previous.addEventListener("click", () => {
              if (new Date(year, month - 1) < new Date()) return;
          
              month--;
              if (month < 0) {
                month = 11;
                year--;
              }
              date.setMonth(month);
              slide("left");
          
              setTimeout(() => {
                displayCalendar(displayLeft, daysLeft);
                displayCalendar(displayRight, daysRight, 1, true);
                displaySelected(daysLeft, selectedLeft);
                displaySelected(daysRight, selectedRange, true);
              }, 300);
            });
          
            next.addEventListener("click", () => {
              month++;
              if (month > 11) {
                month = 0;
                year++;
              }
              date.setMonth(month);
              slide("right");
          
              setTimeout(() => {
                displayCalendar(displayLeft, daysLeft);
                displayCalendar(displayRight, daysRight, 1, true);
                displaySelected(daysLeft, selectedLeft);
                displaySelected(daysRight, selectedRange, true);
              }, 300);
            });
          
            displaySelected(daysLeft, selectedLeft);
            displaySelected(daysRight, selectedRange, true);
            updateSelectedElements();

            $(".onClickHeaderLoginShow").click(function() {
                $("#onClickHeaderLogin").show();
            });
        
            $(document).click(function(event) {
                if (!$(event.target).closest('#onClickHeaderLogin').length && !$(event.target).is('.onClickHeaderLoginShow')) {
                    $("#onClickHeaderLogin").hide();
                }
            });
        
            $('#onClickHeaderLogin').click(function(event){
                event.stopPropagation();
            });

            $(document).on('click', function(event) {
               if (!$(event.target).closest('#onClickHeaderLogin').length &&
                   !$(event.target).is('.onClickHeaderLoginShow') &&
                   event.which === 1) {
                   $("#onClickHeaderLogin").hide();
               }
           });

